I'm glad to help you with that! Here's a simple example of how you can write a code for an ESP32 to read the addresses and temperatures of Dallas 18B20 temperature sensors and display them on the serial monitor. Please note that this code assumes you have the OneWire and DallasTemperature libraries installed.

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Data wire is plugged into pin 2 on the ESP32
#define ONE_WIRE_BUS 2

// Create a OneWire instance to communicate with any OneWire devices
OneWire oneWire(ONE_WIRE_BUS);

// Pass our oneWire reference to Dallas Temperature library
DallasTemperature sensors(&oneWire);

void setup(void)
{
  Serial.begin(9600);
  sensors.begin();
}

void loop(void)
{
  // Start the temperature measurement for all sensors on the bus
  sensors.requestTemperatures();

  // Loop through all sensors on the bus and print their addresses and temperatures
  for (uint8_t i = 0; i < sensors.getDeviceCount(); i++)
  {
    // Get the device's address and temperature
    const DeviceAddress deviceAddress = sensors.getAddress(i);
    float temperature = sensors.getTempCByIndex(i);

    // Print the device's address and temperature
    Serial.print("Device ");
    Serial.print(i + 1);
    Serial.print(" address: ");
    printAddress(deviceAddress);
    Serial.print(" Temperature: ");
    Serial.println(temperature);
  }

  // Wait 1 second before the next reading
  delay(1000);
}

void printAddress(const DeviceAddress &address)
{
  for (uint8_t i = 0; i < 8; i++)
  {
    if (address[i] < 16)
      Serial.print("0");
    Serial.print(address[i], HEX);
    Serial.print(" ");
  }
}
```

This code will display the addresses and temperatures of all Dallas 18B20 temperature sensors connected to the ESP32's pin 2 through the serial monitor at a rate of once per second. Make sure to connect the data wire of your sensors to the specified pin on your ESP32 board.

I'm glad to help you implement the Bubble Sort algorithm in C! Here's a simple implementation:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    for (int i = 0; i < n - 1; i++) {
        for (int j = 0; j < n - i - 1; j++) {
            if (arr[j] > arr[j + 1]) {
                // Swap arr[j] and arr[j+1]
                int temp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = temp;
            }
        }
    }
}

void printArray(int arr[], int size) {
    for (int i = 0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr) / sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Sorted array: \n");
    printArray(arr, n);
    return 0;
}
```

This code sorts an array of integers using the Bubble Sort algorithm and prints the sorted array. You can replace the `arr` array with your own data to test the implementation.

