An "if" statement in Java is a conditional statement that allows you to execute a block of code only if a certain condition is met. The basic syntax for an "if" statement is as follows:

```
if (condition) {
 // code to be executed if the condition is true
}
```

The condition is a boolean expression that evaluates to either true or false. If the condition is true, the code within the curly braces will be executed. If the condition is false, the code within the curly braces will be skipped.

You can also use an "else" statement to specify code that should be executed if the condition is false:

```
if (condition) {
 // code to be executed if the condition is true
} else {
 // code to be executed if the condition is false
}
```

Additionally, you can use an "else if" statement to check multiple conditions:

```
if (condition1) {
 // code to be executed if condition1 is true
} else if (condition2) {
 // code to be executed if condition1 is false and condition2 is true
} else {
 // code to be executed if neither condition1 nor condition2 is true
}
```

It is important to note that the conditions are evaluated in order, and the first one that evaluates to true will be executed. If none of the conditions evaluate to true, the code in the final "else" block will be executed.

Using "if" statements is a fundamental concept in programming and is essential for writing conditional logic in Java.

