Here's a simple JavaScript function that checks if any of the numbers in an array of five numbers are prime numbers and prints them to the console:

```javascript
function checkPrimes(arr) {
 if (arr.length !== 5) {
 console.log("Array must contain exactly 5 numbers.");
 return;
 }

 for (let i = 0; i < arr.length; i++) {
 let num = arr[i];
 if (num < 2) continue;

 for (let j = 2; j <= Math.sqrt(num); j++) {
 if (num % j === 0) {
 // Not a prime number, break the loop
 break;
 }
 }

 // If the loop completed without finding any factors, the number is prime
 if (j > Math.sqrt(num)) {
 console.log(num);
 }
 }
}
```

You can use this function by calling it with an array of five numbers as the argument, like this:

```javascript
let numbers = [3, 5, 7, 9, 11];
checkPrimes(numbers); // Output: 3, 5, 7
```

This function ensures that the input array contains exactly five numbers and checks each number for primality by testing divisibility up to the square root of the number. It also skips numbers less than 2, as they are not prime.

