To create a 'for' loop in Java, you can use the following syntax:

```
for (initialization; condition; increment/decrement) {
 // code to be executed
}
```

Here's an example of a simple 'for' loop that prints numbers from 1 to 10:

```
for (int i = 1; i <= 10; i++) {
 System.out.println(i);
}
```

In this example, the initialization sets the variable `i` to 1, the condition checks if `i` is less than or equal to 10, and the increment/decrement increments the value of `i` by 1 each time the loop iterates. The code inside the loop (`System.out.println(i);`) is executed for each iteration as long as the condition is true.
